import {useParams, Route} from "react-router-dom";

import Comments from "../";

const QuoteDetail = () => {
    const params = useParams();

    return (
        <Fragment>
            <h1>Quote Detail</h1>
            <p>{params.quoteId}</p>
            <Route path={`/quotes/${params.quoteId}/comments`}>

            </Route>
        </Fragment>
    );
};

export default QuoteDetail;
